class Solution(object):
    def pushDominoes(self, dominoes):
        """
        :type dominoes: str
        :rtype: int
        """
        dominoes = list(dominoes)
        n = len(dominoes)
        i = 0
        while i < n:
            if dominoes[i] == '.':
                j = i + 1
                while j < n and dominoes[j] == '.':
                    j += 1
                if j < n and dominoes[j] == 'R':
                    while i < j:
                        dominoes[i] = 'R'
                        i += 1
                elif j < n and dominoes[j] == 'L':
                    while i < j:
                        dominoes[i] = 'L'
                        i += 1
                else:
                    while i < j:
                        dominoes[i] = '.'
                        i += 1
            i += 1
        return dominoes.count('R') + dominoes.count('L')

def main():
    n = int(input())
    s = input()
    count = 0
    for i in range(n):
        if s[i] == '.':
            count += 1
    print(count)


if __name__ == '__main__':
    main()
